export const MemoPage = () => {
  return (
    <div>
      <p>
        useMemo is used to memoize a value so that it is only recalculated when
        the dependencies change. This is useful when a function or expression is
        expensive to compute and is used in a component. By using useMemo, the
        value is only calculated when needed and not on every render.
      </p>
    </div>
  );
};
